import HomePage from "./Components/HomePage/HomePage";
import MainNavbar from "./Components/Navbar/Navbar";

function App() {
  return (
    <div className="App">


<BrowserRouter>
<MainNavbar/>

                <Routes>
                    <Route
                        exact
                        path="/"
                        element={<Home />}
                    />
                    <Route
                        exact
                        path="/about"
                        element={<About />}
                    />
                </Routes>
            </BrowserRouter>

    </div>
  );
}

export default App;
